import 'react-native-gesture-handler';
import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';
import Stylesheet from "./assets/styles";
import HomeScreen from './src/screens/Home';
import AboutScreen from './src/screens/About';
import HelpScreen from './src/screens/Help';
import SubjectScreen from './src/screens/Subjects';
import { SafeAreaProvider } from 'react-native-safe-area-context';

const AboutStack = createStackNavigator();
function AboutStackScreen() {
  return (
    <AboutStack.Navigator initialRouteName="About">
      <AboutStack.Screen name="About" component={AboutScreen} />
      <AboutStack.Screen name="Home" component={HomeScreen} />
    </AboutStack.Navigator>
  );
}

const HomeStack = createStackNavigator();
function HomeStackScreen() {
  return (
    <HomeStack.Navigator initialRouteName="Home">
      <HomeStack.Screen name="About" component={AboutScreen} />
      <HomeStack.Screen name="Home" component={HomeScreen} />
      <HomeStack.Screen name="Help" component={HelpScreen} />
      <HomeStack.Screen name="Subjects" component={SubjectScreen} />
    </HomeStack.Navigator>
  );
}

const Tab = createBottomTabNavigator();

function App() {
  return (
      <NavigationContainer>
        <Tab.Navigator>
          tabBarOptions={{
            activeTintColor: "#5341AF",
            inactiveTintColor: 'gray',
          }}
          <Tab.Screen name="About" component={AboutScreen} />
          <Tab.Screen name="Home" component={HomeStackScreen} />
          <Tab.Screen name="Help" component={HelpScreen} />
        </Tab.Navigator>
      </NavigationContainer>
  );
}

export default App;
